                <div className="Remain_title">
                    <Title>剩餘學分</Title>
                </div>
                <div className='Remain_Course'>
                    <div className='g_Course'>
                        <RemainTitle>通識</RemainTitle>
                    </div>
                    <div className='e_Course'>
                        <RemainTitle>系內選修</RemainTitle>
                    </div>
                    <div className='c_Course'>
                        <RemainTitle>必修</RemainTitle>
                    </div>
                </div>

                    <div className="bee">
